metrics_to_words = {
  "Danceability": [["Dance", "Party"], ["Calm", "Relaxed"]],
  "Energy": [["Energetic", "Party"], ["Chill"]],
  "Valence": [["Happy", "Joy"], ["Sad"]]
}

def get_descriptors():
  descriptors = []
  for val in metrics_to_words.values():
    descriptors = descriptors + val[0] + val[1]
  
  descriptors = list(set(descriptors)) # remove duplicates from metrics_to_words
  return descriptors
  

def get_association_words():
  association_words = []

  association_words += get_descriptors()
  association_words += all_genres
  association_words += big_data.all_eras
  association_words += all_artists


  return association_words


def normalize_descriptor_scores(descriptor_scores: dict):
  """
  Descriptor scores has each descriptor, and the max association value that was found for it
  """
  normalized_descriptor_scores = {}
  for descriptor in get_descriptors():
    mean, stdev = big_data.mean_stdev_descriptors[descriptor]

    print("Descriptor: " + descriptor)
    print("Current score: " + str(descriptor_scores[descriptor]))
    print("Mean: " + str(mean) + ", stdev: " + str(stdev))
    print("Updated value: " + str((descriptor_scores[descriptor] - mean) / stdev))

    normalized_descriptor_scores[descriptor] = (descriptor_scores[descriptor] - mean) / stdev
  
  print(normalized_descriptor_scores)
  return normalized_descriptor_scores


def score_metrics(normalized_descriptor_scores: dict):
  """
  Descriptor scores has each descriptor, and a normalized value for that descriptor, which depends on the prompt
  """
  metric_scores = {}

  for key, value in metrics_to_words.items():
    score = 0
    pos_length = len(value[0])
    neg_length = len(value[1])

    for assoc_word in value[0]:
      score += normalized_descriptor_scores[assoc_word] / pos_length
  
    if neg_length != 0:
      for assoc_word in value[1]:
        score -= normalized_descriptor_scores[assoc_word] / neg_length

    metric_scores[key] = score
  
  return metric_scores


def rank_songs(association_word_scores: dict):
  print("Ranking songs!")
  
  prompt_genres = {}

  # (1) extract genre data from genres - use a cutoff

  for genre in all_genres:
    if association_word_scores[genre] > GENRE_CUTOFF:
      prompt_genres[genre] = prompt_genres.get(genre, 0) + 1

  print("Done (1)")

  # (2) extract genre data from artists
  prompt_artists = set()

  for artist in all_artists:
    if association_word_scores[artist] > ARTIST_CUTOFF: # (2.1) use a cutoff to determine artists
      prompt_artists.add(artist)
      for artist_genre in artist_genres[artist]:
        prompt_genres[artist_genre] = prompt_genres.get(artist_genre, 0) + 1

  print("Finished (2): genres are ...")
  print(prompt_genres)
  print("and artists are:")
  print(prompt_artists)

  # (3) add a field to sort by: fit in genre / don't fit in genre

  def get_genre_score(row):
    # return the proportion of song genres that are in wanted genres
    song_genres = row["Artist Genres"]
    if type(song_genres) != str:
      return 0
    
    song_genres = song_genres.split(",")
    score = 0

    for song_genre in song_genres:
      score += prompt_genres.get(song_genre, 0)
    
    score = int(score / (len(song_genres) + 3/len(song_genres)))  # +3 to nerf really short genre lists that happen to match up

    # take artist into account

    song_artists = row["Artist Name(s)"].split(", ")

    for song_artist in song_artists:
      if song_artist in prompt_artists:
        score += 2 / len(song_artists)

    return score

  df["Genre Score"] = df.apply(get_genre_score, axis=1)

  print("finished (3)")

  # (4) add a field to sort by correct / incorrect era

  eras = []
  for era in big_data.all_eras:
    if association_word_scores[era] > ERA_CUTOFF:
      eras.append(era)

  df["Correct Era"] = df["Album Release Date"].apply(
    lambda release_date: 
    0 if type(release_date) != str else
    (1 if release_date[0:4] in [era[0:4] for era in eras] else 0)
  )

  print("finished (4)")

  # (5) add field to sort by metrics

  metric_scores = score_metrics(normalize_descriptor_scores(association_word_scores))

  print("got metrics score (5.1)")

  def score_song(row):
    '''
    We have:
    - song danceability, energy, valence
    - score of those three from the prompt
    '''
    score = row["Danceability"] * metric_scores["Danceability"] + \
    row["Energy"] * metric_scores["Energy"] + \
    row["Valence"] * metric_scores["Valence"]

    if row["Genre Score"] > 15:
      print("Song: " + str(row["Track Name"]))
      print("Danceability:")
      print(str(row["Danceability"]) + " * " + str(metric_scores["Danceability"]) + " = " + str(row["Danceability"] * metric_scores["Danceability"]))
      print("Energy:" + str(row["Energy"]) + " * " + str(metric_scores["Energy"]) + " = " + \
            str(row["Energy"] * metric_scores["Energy"]))
      print("Valence:" + str(row["Valence"]) + " * " + str(metric_scores["Valence"]) + " = " + \
            str(row["Valence"] * metric_scores["Valence"]))
      print("Score:" + str(score))

    return score


  df["Metrics Score"] = df.apply(score_song, axis=1)


  print("done (5)")


  # (5.1) also sort by popularity?

  # (6) sort, starting with least important metrics

  sorted_df = df.sort_values(
    by=["Genre Score", "Correct Era", "Metrics Score"],
    ascending=[False, False, False])

  print("Printing...")
  print(sorted_df[['Track Name', 'Artist Name(s)', 'Artist Genres', 'Genre Score', 'Metrics Score']].head(50))
  print("Done printing.")

  return sorted_df
  

